import React from 'react';
import './App.css';
import {Switch, Route} from 'react-router-dom';

const Topics=()=>(
    <div>
      <h1>topics paaage</h1>
    </div>
  )
const TopicsDetailed=()=>(
    <div>
      <h1>topics detailed  paaage</h1>
    </div>
)
  const HomePage=()=>(
    <div>
      <h1>hooome paaage</h1>
    </div>
  )
function Routing() {
  return (
    <div>
      <Route exact path='/' component={HomePage}/>
      <Route exact path='/topics' component={Topics}/>
      <Route path='/topics/:topicId' component={TopicsDetailed}/>
 
    </div>

  );
}

export default App;
